pragma solidity >=0.7.0 <0.9.0;

import { IERC165 } from "@openzeppelin/contracts/utils/introspection/IERC165.sol";

interface IBlockClockSvgNft is IERC165 {
  function create(bytes3, bytes3) external;
  function getNftData(uint) external view returns (bool, bytes3, bytes3, uint, address);
  function renderSvgLogo(uint256) external view returns(string memory);
  function getRskBtcBlockNumbers() external view returns(uint256, uint256);
  function transferLunas(uint, uint) external;
  function payLunasForColoursChange(uint, bytes3, bytes3) external;
}
